import '../stylesheets/layout/characterlist.scss';

function CharacterList(props) {
    const renderCharacters = props.characters.map((character) => (
            <li className= "card__css">
              <img src={character.image} alt="img" className="img" />
              <p>{character.name}</p>
              <p>{character.species}</p>
            </li>
          ));
    return (
        <div>
            <h2>Personajes</h2>
            <ul clasName="list__Class">{renderCharacters}</ul>
        </div>
    );
};

export default CharacterList;
